import { useFindTagsQuery } from "../../api/tagsApi";

import Grid from "@mui/material/Grid";

export const TagsPost = () => {

    const {id} = useParams()
    console.log(id)
    const {data, isLoading} = useFindTagsQuery({id})
    console.log(data)

    return (
        <div>
            <div style={{
                fontSize: '42px', 
                color: 'rgb(58, 131, 171)', 
                fontWeight: '600', 
                lineHeight: '36px',
                marginBottom: '40px'
            }}>
                #Заметки
            </div>
            <Grid container spacing={4}>
                <Grid xs={8} item>
                    {(isLoading ? [...Array(3)] : data)
                        .map((obj) => {
                            return (
                                <div></div>
                            )
                        })
                    }
                </Grid>
            </Grid>
        </div>
    )
}
